import Login from '../pages/Login/Login.vue'
import Search from '../pages/Search/Search.vue'
import Home from '../pages/Home/Home.vue'
import Register from '../pages/Register/Register.vue'
import Detail from '../pages/Detail/Detail.vue'
import AddCartSuccess from '../pages/AddCartSuccess/AddCartSuccess.vue'
import ShopCart from '../pages/ShopCart/ShopCart.vue'
import Trade from '../pages/Trade/Trade.vue'

export default [{
        name: 'login',
        path: '/login',
        component: Login,
        meta: {
            isShow: false
        }
    },
    {
        name: 'search',
        path: '/search/:keyword?',
        component: Search,
        meta: {
            isShow: true
        }
    },
    {
        name: 'home',
        path: '/home',
        component: Home,
        meta: {
            isShow: true
        }
    },
    {
        name: 'register',
        path: '/register',
        component: Register,
        meta: {
            isShow: false
        }
    },
    {
        path: '/',
        redirect: '/home',
        meta: {
            isShow: true
        }
    },
    {
        path: '/detail/:skuid',
        name: 'detail',
        component: Detail,
        meta: {
            isShow: false
        }
    },
    {
        name: 'addCartSuccess',
        path: '/addCartSuccess',
        component: AddCartSuccess,
        meta: {
            isShow: true
        }
    },
    {
        name: 'shopCart',
        path: '/shopCart',
        component: ShopCart,
        meta: {
            isShow: true
        }
    },
]
